import React from 'react'
import { FaLocationArrow } from 'react-icons/fa';

function SearchBar() {
  return (
    <div className='searchbar'>
        <FaLocationArrow></FaLocationArrow>
        <div>
        <label>Điểm đi</label><input type='text' value={'Nơi xuất phát'}></input>
        </div>
        
        <label>Điểm đến</label><input type='text' value={'Nơi đến'}></input>
        <label>Ngày đi</label><input type='date' value={'nơi xuất phát'}></input>
    </div>
  )
}

export default SearchBar
